import {
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableHeader,
    TableRow,
  } from '@/components/ui/table'
  import TCard from '@/components/t_card'
export default function Devices({ data }) { 
    return (
        <TCard title="把账户粘贴到这里">
          <Table>
            <TableHeader>
              <TableRow>
                <TableHead>序号</TableHead>
                <TableHead>用户名</TableHead>
                <TableHead>密码</TableHead>
              </TableRow>
            </TableHeader>
            <TableBody>
              {data &&
                data.map((account: string[], index: number) => {
                  return (
                    <TableRow key={index}>
                      <TableCell>{index + 1}</TableCell>
                      <TableCell>{account[0]}</TableCell>
                      <TableCell>{account[1]}</TableCell>
                    </TableRow>
                  )
                })}
            </TableBody>
          </Table>
        </TCard>
      )
}
